import React from 'react'
import './User.css'

// user = {
//     name: Rajat,
//     pic: "",
//     userType: "startup",
//     location: "Delhi",
//     AOI: []
// }
export default function User() {
    let user = {
            name: "Rajat Choudhary",
            pic: "",
            userType: "startup",
            location: "Delhi",
            summary: "lorem epsumlorem epsumlorem epsumlorem epsumlorem epsumlorem epsum",
            AOI: []
        }
    return (
        <div className="col-12 col-sm-6 col-md-4 Feed-user">
                <div className="Feed-user-image"></div>
                <div className="Feed-user-name">
                    <p className="user-main-name">{user.name}</p>
                    <p>{user.location}</p>
                </div>
                <div>{user.summary}</div>
        </div>
    )
}
